INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 60000, 1, 1, 0, "", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 1, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 1, "", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "", 2, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 1, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 3, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 2, 0, 1, "", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "", 4, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 2, "", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "", 5, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 2, "", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "", 6, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 2, 0, 2, "", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "", 7, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 3, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "", 8, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 3, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 9, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 3, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 10, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 3, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 11, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 2, 0, 3, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "", 12, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 4, "", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "", 13, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 4, "", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "", 14, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 4, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 15, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 1, 0, 4, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 16, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60000, 2, 0, 4, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 17, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 60000, 0, 2, 0, "", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "カリン", 18, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 60000, 0, 3, 0, "", 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "カリン", 19, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", "ハツネ", 20, 0, 101201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 1, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", "ハツネ", 21, 0, 101201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", "シオリ", 22, 0, 103801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 1, "来年も、\n一緒にいられたら…\nうれしいな", "シオリ", 23, 0, 103801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 2, "あなたと一緒にいるようになって、\nもう1年ですか…", "キョウカ", 24, 0, 103601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", "キョウカ", 25, 0, 103601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 2, "おにいちゃんとあってから、\n1年たったよ～！", "ミミ", 26, 0, 102001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", "ミミ", 27, 0, 102001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 1, 0, "", 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", "ミソギ", 28, 0, 100401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 2, 0, "", 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", "ミソギ", 29, 0, 100401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 3, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", "マホ", 30, 0, 101001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 3, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", "マホ", 31, 0, 101001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 3, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", "イリヤ", 32, 0, 104401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 3, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", "イリヤ", 33, 0, 104401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 1, 0, "", 3, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", "カオリ", 34, 0, 101701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 2, 0, "", 3, "これからも、どうぞよろしく\nお願いするさ～！", "カオリ", 35, 0, 101701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 4, "あんたと出会ってからもうそんなに\nたつのね～", "サレン", 36, 0, 102801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 4, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", "サレン", 37, 0, 102801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 4, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", "スズメ", 38, 0, 102501);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 4, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", "スズメ", 39, 0, 102501);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 5, "振り返れば、今までいろんなことが\nあったにゃあ…", "タマキ", 40, 0, 104601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 5, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", "タマキ", 41, 0, 104601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 5, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", "ミフユ", 42, 0, 104801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 5, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", "ミフユ", 43, 0, 104801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 6, "あなたさまと出会ってもう1年…", "アキノ", 44, 0, 103201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 6, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", "アキノ", 45, 0, 103201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 6, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", "ユカリ", 46, 0, 103401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 6, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", "ユカリ", 47, 0, 103401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 7, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", "クリスティーナ", 48, 0, 107101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 7, "ともかくこれからも\n愉しませてくれよ☆", "クリスティーナ", 49, 0, 107101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 7, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", "ジュン", 50, 0, 104701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 7, "見えないから分からないって？\nそれもそうだな…", "ジュン", 51, 0, 104701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 8, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", "トモ", 52, 0, 103701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 8, "これからもよろしくね！", "トモ", 53, 0, 103701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 8, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", "マツリ", 54, 0, 100501);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 8, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", "マツリ", 55, 0, 100501);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 9, "オマエと会って1年なの！\n全然成仏もできなかったし、", "ミヤコ", 56, 0, 100701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 9, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", "ミヤコ", 57, 0, 100701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 9, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", "シノブ", 58, 0, 103101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 9, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", "シノブ", 59, 0, 103101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 10, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", "アンナ", 60, 0, 100901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 10, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", "アンナ", 61, 0, 100901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 10, "君と出会ってもう1年だって！\n早いねー！", "ナナカ", 62, 0, 101301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 10, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", "ナナカ", 63, 0, 101301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 11, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", "ミツキ", 64, 0, 105101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 11, "これからも、いろんなところを\n調べさせてね？", "ミツキ", 65, 0, 105101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 11, "お前さんと出会ってもう1年か\n助太刀するつもりが", "ルカ", 66, 0, 105601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 11, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", "ルカ", 67, 0, 105601);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 1, 0, "", 11, "早いものですわね、あなた様と\nお会いして、もう1年…", "エリコ", 68, 0, 102701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 2, 0, "", 11, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", "エリコ", 69, 0, 102701);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 12, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", "アヤネ", 70, 0, 102301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 12, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", "アヤネ", 71, 0, 102301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 12, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", "チカ", 72, 0, 104201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 12, "私のことを見守ってください\nできることなら、ずっと…", "チカ", 73, 0, 104201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 1, 0, "", 12, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", "クルミ", 74, 0, 102101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 2, 0, "", 12, "で、でもこれからもずっと…\n一緒にいたいなぁ…", "クルミ", 75, 0, 102101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 13, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", "シズル", 76, 0, 104901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 13, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", "シズル", 77, 0, 104901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 13, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", "リノ", 78, 0, 101101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 13, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", "リノ", 79, 0, 101101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 14, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", "ユイ", 80, 0, 100201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 14, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", "ユイ", 81, 0, 100201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 14, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", "ヒヨリ", 82, 0, 100101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 14, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", "ヒヨリ", 83, 0, 100101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 1, 0, "", 14, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", "レイ", 84, 0, 100301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 2, 0, "", 14, "キミに背中を預けられる日が、\n早くきますように", "レイ", 85, 0, 100301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 1, 0, "", 15, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", "ペコリーヌ", 86, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80001, 0, 2, 0, "", 15, "これからもずっと、覚えていて\nくださいね！", "ペコリーヌ", 87, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 1, 0, "", 15, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", "コッコロ", 88, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80001, 0, 2, 0, "", 15, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", "コッコロ", 89, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 1, 0, "", 15, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", "キャル", 90, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80001, 0, 2, 0, "", 15, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", "キャル", 91, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 60001, 1, 1, 0, "", 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", "スズメ", 92, 0, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 1, "", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "", 93, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 1, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 94, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 1, "", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 95, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 1, "", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 96, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 2, 0, 1, "", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "", 97, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 2, "", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "", 98, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 2, "", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "", 99, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 2, "", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 100, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 2, "", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 101, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 2, 0, 2, "", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "", 102, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 3, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "", 103, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 3, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 104, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 3, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 105, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 3, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 106, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 3, "", 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", "", 107, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 3, "", 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", "", 108, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 2, 0, 3, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "", 109, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 4, "", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "", 110, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 4, "", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "", 111, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 4, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 112, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 4, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 113, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 4, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 114, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 1, 0, 4, "", 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", "", 115, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60001, 2, 0, 4, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 116, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 60001, 0, 2, 0, "", 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", "スズメ", 117, 0, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 60001, 0, 3, 0, "", 7, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", "スズメ", 118, 0, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 1, 0, "", 1, "ヒューヒュー♪\nドンドンパフパフー♪", "ペコリーヌ", 119, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 1, 0, "", 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", "コッコロ", 120, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 2, 0, "", 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", "コッコロ", 121, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 1, 0, "", 1, "え？　ちょっと\nいきなりなにっ？", "キャル", 122, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 2, 0, "", 1, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", "キャル", 123, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 2, 0, "", 1, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", "ペコリーヌ", 124, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 3, 0, "", 1, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", "ペコリーヌ", 125, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 3, 0, "", 1, "ですからその日に向けて\n今から気分を盛り上げているのです", "コッコロ", 126, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 3, 0, "", 1, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", "キャル", 127, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 4, 0, "", 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", "コッコロ", 128, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 4, 0, "", 1, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", "ペコリーヌ", 129, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 4, 0, "", 1, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", "キャル", 130, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 5, 0, "", 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", "コッコロ", 131, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 5, 0, "", 2, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", "キャル", 132, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 1, 0, "", 2, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", "カリン", 133, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 6, 0, "", 2, "げっ…カリンじゃない\nなんでもないわよ！", "キャル", 134, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 2, 0, "", 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", "カリン", 135, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 7, 0, "", 2, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", "キャル", 136, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 3, 0, "", 2, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", "カリン", 137, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 8, 0, "", 2, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", "キャル", 138, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 9, 0, "", 2, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", "キャル", 139, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 4, 0, "", 2, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", "カリン", 140, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 10, 0, "", 2, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", "キャル", 141, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 5, 0, "", 2, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", "カリン", 142, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 11, 0, "", 2, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", "キャル", 143, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 6, 0, "", 3, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", "コッコロ", 144, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 5, 0, "", 3, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", "ペコリーヌ", 145, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 7, 0, "", 3, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", "コッコロ", 146, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 8, 0, "", 3, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", "コッコロ", 147, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 6, 0, "", 3, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", "ペコリーヌ", 148, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 7, 0, "", 3, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", "ペコリーヌ", 149, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 9, 0, "", 3, "あとは、牧場に素敵な温泉が\n出来たとか…", "コッコロ", 150, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 8, 0, "", 3, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", "ペコリーヌ", 151, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 10, 0, "", 3, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", "コッコロ", 152, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 9, 0, "", 3, "えへへ、ありがとうございます\nコッコロちゃん！", "ペコリーヌ", 153, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 11, 0, "", 3, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", "コッコロ", 154, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 10, 0, "", 3, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", "ペコリーヌ", 155, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 11, 0, "", 4, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", "ペコリーヌ", 156, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 12, 0, "", 4, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", "キャル", 157, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 12, 0, "", 4, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", "ペコリーヌ", 158, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 13, 0, "", 4, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", "キャル", 159, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 13, 0, "", 4, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", "ペコリーヌ", 160, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 14, 0, "", 4, "…積極的？\nなんの話よ？", "キャル", 161, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 14, 0, "", 4, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", "ペコリーヌ", 162, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 15, 0, "", 4, "ムーサの町で\nきゃるきゃる～ん☆　って！", "ペコリーヌ", 163, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 15, 0, "", 4, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", "キャル", 164, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 16, 0, "", 4, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", "ペコリーヌ", 165, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 16, 0, "", 4, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", "キャル", 166, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 17, 0, "", 4, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", "キャル", 167, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 18, 0, "", 5, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", "キャル", 168, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 12, 0, "", 5, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", "コッコロ", 169, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 19, 0, "", 5, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", "キャル", 170, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 13, 0, "", 5, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", "コッコロ", 171, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 20, 0, "", 5, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", "キャル", 172, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 14, 0, "", 5, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", "コッコロ", 173, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 21, 0, "", 5, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", "キャル", 174, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 15, 0, "", 5, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", "コッコロ", 175, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 22, 0, "", 5, "かくし芸？", "キャル", 176, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 16, 0, "", 5, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", "コッコロ", 177, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 23, 0, "", 5, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", "キャル", 178, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 17, 0, "", 6, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", "ペコリーヌ", 179, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 24, 0, "", 6, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", "キャル", 180, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 17, 0, "", 6, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", "コッコロ", 181, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 18, 0, "", 6, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", "ペコリーヌ", 182, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 25, 0, "", 6, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", "キャル", 183, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 18, 0, "", 6, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", "コッコロ", 184, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 26, 0, "", 6, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", "キャル", 185, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 27, 0, "", 6, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", "キャル", 186, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 28, 0, "", 6, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", "キャル", 187, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 19, 0, "", 6, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", "ペコリーヌ", 188, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 19, 0, "", 6, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", "コッコロ", 189, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 29, 0, "", 6, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", "キャル", 190, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 30, 0, "", 7, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", "キャル", 191, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 31, 0, "", 7, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", "キャル", 192, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 32, 0, "", 7, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", "キャル", 193, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 33, 0, "", 7, "あー\nあー\n…声、これで大丈夫かしら？", "キャル", 194, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 34, 0, "", 7, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", "キャル", 195, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 35, 0, "", 7, "オイッスー☆", "キャル", 196, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 36, 0, "", 7, "……\nいや、ないわ\nいつもどおりが一番ね、うん", "キャル", 197, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 37, 0, "", 7, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", "キャル", 198, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 38, 0, "", 7, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", "キャル", 199, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 20, 0, "", 8, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", "コッコロ", 200, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 21, 0, "", 8, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", "コッコロ", 201, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 22, 0, "", 8, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", "コッコロ", 202, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 23, 0, "", 8, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", "コッコロ", 203, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 24, 0, "", 8, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", "コッコロ", 204, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 25, 0, "", 8, "オイッスー☆", "コッコロ", 205, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 26, 0, "", 8, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", "コッコロ", 206, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 27, 0, "", 8, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", "コッコロ", 207, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 28, 0, "", 8, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", "コッコロ", 208, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 20, 0, "", 9, "オイッスー☆", "ペコリーヌ", 209, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 21, 0, "", 9, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", "ペコリーヌ", 210, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 22, 0, "", 9, "あと６日で2.5周年ですか…", "ペコリーヌ", 211, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 23, 0, "", 9, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", "ペコリーヌ", 212, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 24, 0, "", 9, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", "ペコリーヌ", 213, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 25, 0, "", 9, "オイッスー☆", "ペコリーヌ", 214, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 26, 0, "", 9, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", "ペコリーヌ", 215, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 27, 0, "", 9, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", "ペコリーヌ", 216, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 28, 0, "", 9, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", "ペコリーヌ", 217, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 29, 0, "", 9, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", "ペコリーヌ", 218, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 30, 0, "", 9, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", "ペコリーヌ", 219, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 31, 0, "", 10, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", "ペコリーヌ", 220, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 29, 0, "", 10, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", "コッコロ", 221, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 32, 0, "", 10, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", "ペコリーヌ", 222, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 39, 0, "", 10, "…………", "キャル", 223, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 30, 0, "", 10, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", "コッコロ", 224, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 40, 0, "", 10, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", "キャル", 225, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 33, 0, "", 10, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", "ペコリーヌ", 226, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 41, 0, "", 10, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", "キャル", 227, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 34, 0, "", 10, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", "ペコリーヌ", 228, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 35, 0, "", 10, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", "ペコリーヌ", 229, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 42, 0, "", 10, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", "キャル", 230, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 31, 0, "", 10, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", "コッコロ", 231, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 43, 0, "", 10, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", "キャル", 232, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 36, 0, "", 10, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", "ペコリーヌ", 233, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 6, 0, "", 11, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", "カリン", 234, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 7, 0, "", 11, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", "カリン", 235, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 8, 0, "", 11, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", "カリン", 236, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 9, 0, "", 11, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", "カリン", 237, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 10, 0, "", 11, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", "カリン", 238, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 11, 0, "", 11, "次にコッコロさんですが\nこちらは発声練習をしています", "カリン", 239, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 12, 0, "", 11, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", "カリン", 240, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 13, 0, "", 11, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", "カリン", 241, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 14, 0, "", 11, "あれ？\nもしかして緊張で気を失って…？", "カリン", 242, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 15, 0, "", 11, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", "カリン", 243, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 16, 0, "", 11, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", "カリン", 244, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 17, 0, "", 11, "それでは\nまた明日お会いしましょう♪", "カリン", 245, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 44, 0, "", 12, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", "キャル", 246, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 37, 0, "", 12, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", "ペコリーヌ", 247, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 32, 0, "", 12, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", "コッコロ", 248, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 45, 0, "", 12, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", "キャル", 249, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 38, 0, "", 12, "ひどいですよぉキャルちゃ～ん！", "ペコリーヌ", 250, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 33, 0, "", 12, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", "コッコロ", 251, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 39, 0, "", 12, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", "ペコリーヌ", 252, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 46, 0, "", 12, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", "キャル", 253, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 34, 0, "", 12, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", "コッコロ", 254, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 40, 0, "", 12, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", "ペコリーヌ", 255, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 41, 0, "", 13, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", "ペコリーヌ", 256, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 47, 0, "", 13, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", "キャル", 257, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 42, 0, "", 13, "忘れてきちゃいました☆", "ペコリーヌ", 258, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 48, 0, "", 13, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", "キャル", 259, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 35, 0, "", 13, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", "コッコロ", 260, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 49, 0, "", 13, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", "キャル", 261, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 43, 0, "", 13, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", "ペコリーヌ", 262, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 50, 0, "", 13, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", "キャル", 263, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 36, 0, "", 13, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", "コッコロ", 264, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 51, 0, "", 13, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", "キャル", 265, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 37, 0, "", 13, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", "コッコロ", 266, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 52, 0, "", 13, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", "キャル", 267, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 44, 0, "", 13, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", "ペコリーヌ", 268, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 38, 0, "", 13, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", "コッコロ", 269, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 45, 0, "", 13, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", "ペコリーヌ", 270, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 53, 0, "", 13, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", "キャル", 271, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 46, 0, "", 13, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", "ペコリーヌ", 272, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 18, 0, "", 14, "こんにちは\n【ギルド管理協会】のカリンです", "カリン", 273, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 19, 0, "", 14, "昨日の生放送は\nいかがだったでしょうか？", "カリン", 274, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 20, 0, "", 14, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", "カリン", 275, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 21, 0, "", 14, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", "カリン", 276, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 22, 0, "", 14, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", "カリン", 277, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 23, 0, "", 14, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", "カリン", 278, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 24, 0, "", 14, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", "カリン", 279, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 25, 0, "", 14, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", "カリン", 280, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 26, 0, "", 14, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", "カリン", 281, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 27, 0, "", 14, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", "カリン", 282, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 47, 0, "", 15, "準備はいいですかっ？\n…いっきますよー！", "ペコリーヌ", 283, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 54, 0, "", 15, "祝！", "キャル", 284, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 39, 0, "", 15, "2.5周年！", "コッコロ", 285, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 48, 0, "", 15, "おめでとうございま～す☆", "ペコリーヌ", 286, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 55, 0, "", 15, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", "キャル", 287, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 40, 0, "", 15, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", "コッコロ", 288, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 49, 0, "", 15, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", "ペコリーヌ", 289, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 56, 0, "", 15, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", "キャル", 290, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 41, 0, "", 15, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", "コッコロ", 291, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 57, 0, "", 15, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", "キャル", 292, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 50, 0, "", 15, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", "ペコリーヌ", 293, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 58, 0, "", 15, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", "キャル", 294, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 51, 0, "", 15, "記念日だから\n平気平気♪\nやばいですね☆", "ペコリーヌ", 295, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 59, 0, "", 15, "意味分かんないわよ！", "キャル", 296, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 42, 0, "", 15, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", "コッコロ", 297, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 43, 0, "", 15, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", "コッコロ", 298, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 52, 0, "", 15, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", "ペコリーヌ", 299, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80003, 0, 60, 0, "", 15, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", "キャル", 300, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80003, 0, 44, 0, "", 15, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", "コッコロ", 301, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 53, 0, "", 15, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", "ペコリーヌ", 302, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80003, 0, 54, 0, "105901,45,106001,61", 15, "2.5周年\nありがとうございます！", "ペコリーヌ・コッコロ・キャル", 303, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 60002, 1, 1, 0, "", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 304, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 1, "", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 305, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 1, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 306, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 1, "", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 307, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 1, "", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 308, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 2, 0, 1, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 309, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 2, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 310, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 2, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 311, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 2, "", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 312, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 2, "", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 313, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 2, 0, 2, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 314, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 3, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 315, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 3, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 316, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 3, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 317, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 3, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 318, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 3, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", "", 319, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 3, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 320, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 2, 0, 3, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", "", 321, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 4, "", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "", 322, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 4, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 323, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 4, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "", 324, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 4, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 325, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 4, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 326, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 1, 0, 4, "", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", "", 327, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60002, 2, 0, 4, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 328, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 60002, 0, 2, 0, "", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "カリン", 329, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 60002, 0, 3, 0, "", 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "カリン", 330, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 1, 0, "", 1, "ささ、シェフィさまはこちらへ…", "コッコロ", 331, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 1, 0, "", 1, "コッコロさん、どこへ行くの…？\n…え？", "シェフィ", 332, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 1, 0, "", 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", "ペコリーヌ", 333, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 2, 0, "", 1, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", "コッコロ", 334, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 2, 0, "", 1, "ええと…\n二人とも何をしているの？", "シェフィ", 335, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 1, 0, "", 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", "キャル", 336, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 3, 0, "", 1, "あの日…？", "シェフィ", 337, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 2, 0, "", 1, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", "ペコリーヌ", 338, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 3, 0, "", 1, "『プリンセスコネクト！\nRe:Dive』3.5周年！", "ペコリーヌ", 339, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 1, 0, "", 1, "やばいですね☆", "カリン", 340, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 2, 0, "", 1, "って、なにしれっと\n参加してんのよカリン！", "キャル", 341, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 2, 0, "", 1, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", "カリン", 342, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 3, 0, "", 1, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", "カリン", 343, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 4, 0, "", 1, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", "ペコリーヌ", 344, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 4, 0, "", 1, "えっ！？　ええとええと…！\nあ、あと14日…！", "シェフィ", 345, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 5, 0, "", 2, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", "ペコリーヌ", 346, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 3, 0, "", 2, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", "コッコロ", 347, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 4, 0, "", 2, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", "コッコロ", 348, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 6, 0, "", 2, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", "ペコリーヌ", 349, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 5, 0, "", 2, "さすがでございます\nペコリーヌさま", "コッコロ", 350, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 3, 0, "", 2, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", "キャル", 351, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 5, 0, "", 2, "しゃなり、しゃなり…\nふふ、案外できるものね", "シェフィ", 352, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 7, 0, "", 2, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", "ペコリーヌ", 353, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 6, 0, "", 2, "さ、次はキャルさまの\n番でございますよ", "コッコロ", 354, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 4, 0, "", 2, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", "キャル", 355, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 6, 0, "", 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", "シェフィ", 356, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 5, 0, "", 2, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", "キャル", 357, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 6, 0, "", 2, "いたたた…もぉお～！\nなんであたしがこんな目に～！", "キャル", 358, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 7, 0, "", 2, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", "コッコロ", 359, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 7, 0, "", 2, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", "キャル", 360, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 8, 0, "", 3, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", "コッコロ", 361, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 8, 0, "", 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", "ペコリーヌ", 362, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 9, 0, "", 3, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", "コッコロ", 363, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 7, 0, "", 3, "聖学祭…って、なにかしら？", "シェフィ", 364, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 10, 0, "", 3, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", "コッコロ", 365, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 8, 0, "", 3, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", "キャル", 366, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 9, 0, "", 3, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", "キャル", 367, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 9, 0, "", 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", "ペコリーヌ", 368, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 10, 0, "", 3, "いや、そのまんますぎでしょ…", "キャル", 369, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 8, 0, "", 3, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", "シェフィ", 370, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 10, 0, "", 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", "ペコリーヌ", 371, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 9, 0, "", 3, "えっ？　ええ…\nぎゅーっ…？", "シェフィ", 372, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 11, 0, "", 4, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", "キャル", 373, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 10, 0, "", 4, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", "シェフィ", 374, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 12, 0, "", 4, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", "キャル", 375, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 11, 0, "", 4, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", "コッコロ", 376, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 13, 0, "", 4, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", "キャル", 377, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 11, 0, "", 4, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", "ペコリーヌ", 378, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 14, 0, "", 4, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", "キャル", 379, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 15, 0, "", 4, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", "キャル", 380, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 11, 0, "", 4, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", "シェフィ", 381, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 12, 0, "", 4, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", "ペコリーヌ", 382, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 12, 0, "", 4, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", "コッコロ", 383, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 16, 0, "", 4, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", "キャル", 384, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 12, 0, "", 4, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", "シェフィ", 385, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 13, 0, "", 5, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", "ペコリーヌ", 386, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 14, 0, "", 5, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", "ペコリーヌ", 387, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 15, 0, "", 5, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", "ペコリーヌ", 388, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 17, 0, "", 5, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", "キャル", 389, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 18, 0, "", 5, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", "キャル", 390, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 13, 0, "", 5, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", "シェフィ", 391, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 13, 0, "", 5, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", "コッコロ", 392, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 16, 0, "", 5, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", "ペコリーヌ", 393, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 19, 0, "", 5, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", "キャル", 394, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 17, 0, "", 5, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", "ペコリーヌ", 395, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 18, 0, "", 5, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", "ペコリーヌ", 396, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 19, 0, "", 5, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", "ペコリーヌ", 397, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 4, 0, "", 6, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", "カリン", 398, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 5, 0, "", 6, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", "カリン", 399, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 20, 0, "", 6, "…えっ！？", "キャル", 400, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 20, 0, "", 6, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", "ペコリーヌ", 401, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 14, 0, "", 6, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", "シェフィ", 402, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 14, 0, "", 6, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", "コッコロ", 403, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 15, 0, "", 6, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", "シェフィ", 404, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 21, 0, "", 6, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", "キャル", 405, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 21, 0, "", 6, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", "ペコリーヌ", 406, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 22, 0, "", 6, "ぶっ殺すぞ！？", "キャル", 407, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 6, 0, "", 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", "カリン", 408, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 15, 0, "", 7, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", "コッコロ", 409, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 23, 0, "", 7, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", "キャル", 410, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 16, 0, "", 7, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", "シェフィ", 411, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 22, 0, "", 7, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", "ペコリーヌ", 412, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 24, 0, "", 7, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", "キャル", 413, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 17, 0, "", 7, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", "シェフィ", 414, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 16, 0, "", 7, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", "コッコロ", 415, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 18, 0, "", 7, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", "シェフィ", 416, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 17, 0, "", 7, "もちろんでございます\n仲良くお勉強いたしましょう", "コッコロ", 417, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 25, 0, "", 7, "しれっと教育ママが\n生まれてる…？", "キャル", 418, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 23, 0, "", 7, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", "ペコリーヌ", 419, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 26, 0, "", 7, "え～～～～！？", "キャル", 420, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 27, 0, "", 8, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", "キャル", 421, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 19, 0, "", 8, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", "シェフィ", 422, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 18, 0, "", 8, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", "コッコロ", 423, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 24, 0, "", 8, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", "ペコリーヌ", 424, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 20, 0, "", 8, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", "シェフィ", 425, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 28, 0, "", 8, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", "キャル", 426, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 19, 0, "", 8, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", "コッコロ", 427, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 21, 0, "", 8, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", "シェフィ", 428, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 29, 0, "", 8, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", "キャル", 429, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 30, 0, "", 8, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", "キャル", 430, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 25, 0, "", 8, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", "ペコリーヌ", 431, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 31, 0, "", 8, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", "キャル", 432, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 22, 0, "", 9, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", "シェフィ", 433, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 23, 0, "", 9, "…えっ？\n生放送の意気込み！？\n突然なに！？", "シェフィ", 434, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 24, 0, "", 9, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", "シェフィ", 435, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 25, 0, "", 9, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", "シェフィ", 436, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 26, 0, "", 9, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", "シェフィ", 437, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 27, 0, "", 9, "それから、それから…！\nぅ、ぅぅっ…！", "シェフィ", 438, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 28, 0, "", 9, "―びえぇぇ～んっ！！！", "シェフィ", 439, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 20, 0, "", 9, "どうされましたか、シェフィさま", "コッコロ", 440, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 29, 0, "", 9, "ううっ…ひっく…\nママッ…！", "シェフィ", 441, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 21, 0, "", 9, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", "コッコロ", 442, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 22, 0, "", 9, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", "コッコロ", 443, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 30, 0, "", 9, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", "シェフィ", 444, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 23, 0, "", 10, "主さま\n3.5周年まであと５日\nでございます", "コッコロ", 445, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 24, 0, "", 10, "ですがその前に\n生放送がありますね", "コッコロ", 446, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 25, 0, "", 10, "…生放送に向けた\n意気込みでございますか？", "コッコロ", 447, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 26, 0, "", 10, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", "コッコロ", 448, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 27, 0, "", 10, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", "コッコロ", 449, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 28, 0, "", 10, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", "コッコロ", 450, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 29, 0, "", 10, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", "コッコロ", 451, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 30, 0, "", 10, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", "コッコロ", 452, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 31, 0, "", 10, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", "コッコロ", 453, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 26, 0, "", 11, "3.5周年まであと４日！\nやばいですね☆", "ペコリーヌ", 454, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 32, 0, "", 11, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", "キャル", 455, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 27, 0, "", 11, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", "ペコリーヌ", 456, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 28, 0, "", 11, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", "ペコリーヌ", 457, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 29, 0, "", 11, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", "ペコリーヌ", 458, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 33, 0, "", 11, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", "キャル", 459, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 30, 0, "", 11, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", "ペコリーヌ", 460, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 31, 0, "", 11, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", "ペコリーヌ", 461, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 32, 0, "", 11, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", "ペコリーヌ", 462, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 34, 0, "", 11, "だからあたしはやるなんて一言も…", "キャル", 463, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 33, 0, "", 11, "オイッスー☆", "ペコリーヌ", 464, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 35, 0, "", 11, "聞きなさいっての！！", "キャル", 465, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 31, 0, "", 12, "3.5周年まであと３日…\nそして生放送は、明日…", "シェフィ", 466, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 32, 0, "", 12, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", "シェフィ", 467, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 33, 0, "", 12, "おいっす！\n…こうじゃなかったわね\nええと確か…", "シェフィ", 468, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 34, 0, "", 12, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", "シェフィ", 469, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 35, 0, "", 12, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", "シェフィ", 470, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 34, 0, "", 12, "やってますねシェフィちゃん！", "ペコリーヌ", 471, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 36, 0, "", 12, "なによ、考えることは\nみんな同じってこと？", "キャル", 472, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 32, 0, "", 12, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", "コッコロ", 473, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 36, 0, "", 12, "みんな…もちろんよ！", "シェフィ", 474, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 35, 0, "", 12, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", "ペコリーヌ", 475, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 7, 0, "", 13, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", "カリン", 476, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 8, 0, "", 13, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", "カリン", 477, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 36, 0, "", 13, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", "ペコリーヌ", 478, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 9, 0, "", 13, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", "カリン", 479, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 33, 0, "", 13, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", "コッコロ", 480, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 10, 0, "", 13, "さすが【美食殿】のママですね！\nそしてキャルさんは…", "カリン", 481, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 37, 0, "", 13, "大丈夫…大丈夫…\nあたしは大丈夫…", "キャル", 482, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 11, 0, "", 13, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", "カリン", 483, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 37, 0, "", 13, "あうー？", "シェフィ", 484, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 37, 0, "105901,34,106001,38,190801,12", 13, "あ…", "みんな", 485, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 39, 0, "", 13, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", "キャル", 486, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 35, 0, "", 13, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", "コッコロ", 487, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 38, 0, "", 13, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", "ペコリーヌ", 488, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 13, 0, "", 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", "カリン", 489, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 38, 0, "", 14, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", "シェフィ", 490, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 39, 0, "", 14, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", "ペコリーヌ", 491, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 40, 0, "", 14, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", "キャル", 492, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 36, 0, "", 14, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", "コッコロ", 493, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 39, 0, "", 14, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", "シェフィ", 494, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 40, 0, "", 14, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", "ペコリーヌ", 495, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 37, 0, "", 14, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", "コッコロ", 496, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 41, 0, "", 14, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", "キャル", 497, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 40, 0, "", 14, "へ、へぇ…", "シェフィ", 498, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 41, 0, "", 14, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", "ペコリーヌ", 499, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 41, 0, "", 14, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", "シェフィ", 500, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 42, 0, "", 14, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", "シェフィ", 501, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 42, 0, "", 15, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", "ペコリーヌ", 502, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 42, 0, "", 15, "祝！", "キャル", 503, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 38, 0, "", 15, "3.5周年！", "コッコロ", 504, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 43, 0, "", 15, "おめでとうございます！", "シェフィ", 505, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 14, 0, "", 15, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", "カリン", 506, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 80005, 0, 15, 0, "", 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", "カリン", 507, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 43, 0, "", 15, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", "ペコリーヌ", 508, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 44, 0, "", 15, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", "ペコリーヌ", 509, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 43, 0, "", 15, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", "キャル", 510, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 80005, 0, 44, 0, "", 15, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", "キャル", 511, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 44, 0, "", 15, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", "シェフィ", 512, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (0, 80005, 0, 45, 0, "", 15, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", "シェフィ", 513, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 39, 0, "", 15, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", "コッコロ", 514, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 40, 0, "", 15, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", "コッコロ", 515, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 41, 0, "", 15, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", "コッコロ", 516, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 80005, 0, 45, 0, "", 15, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", "ペコリーヌ", 517, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (4, 80005, 0, 46, 0, "105901,42,106001,45,106401,46,190801,16", 15, "これからも\nよろしくおねがいします！", "みんな", 518, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 60003, 1, 1, 0, "", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 519, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 1, "", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 520, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 1, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 521, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 1, "", 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", "", 522, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 1, "", 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", "", 523, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 2, 0, 1, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 524, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 2, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 525, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 2, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 526, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 2, "", 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", "", 527, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 2, "", 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", "", 528, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 2, 0, 2, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 529, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 3, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 530, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 3, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 531, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 3, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 532, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 3, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 533, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 3, "", 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", "", 534, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 3, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 535, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 2, 0, 3, "", 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", "", 536, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 4, "", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "", 537, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 4, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 538, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 4, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "", 539, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 4, "", 0, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", "", 540, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 4, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 541, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 1, 0, 4, "", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", "", 542, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60003, 2, 0, 4, "", 0, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", "", 543, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 60003, 0, 2, 0, "", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "カリン", 544, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (3, 60003, 0, 3, 0, "", 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "カリン", 545, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (1, 60004, 1, 1, 0, "", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 546, 0, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 1, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 547, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 1, "", 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", "", 548, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 1, "", 0, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", "", 549, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 1, "", 0, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", "", 550, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 1, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 551, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 2, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 552, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 2, 0, 2, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 553, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 2, "", 0, "今日の運勢は大吉！　ラッキーワードは「ぴょんぴょん♪」\nおっきな声で一緒に言ってみよ～♪　うさぎさんぴょんぴょ～ん♪", "", 554, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 2, "", 0, "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", "", 555, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 2, "", 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", "", 556, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 3, "", 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", "", 557, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 2, 0, 3, "", 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", "", 558, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 3, "", 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", "", 559, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 3, "", 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", "", 560, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 3, "", 0, "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", "", 561, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 3, "", 0, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", "", 562, 0, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES (2, 60004, 1, 0, 3, "", 0, "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", "", 563, 0, 0);
